/*!50003 CREATE*/ /*!50017 */ /*!50003 TRIGGER `licenca_BEFORE_UPDATE` BEFORE UPDATE ON `licenca`



 FOR EACH ROW BEGIN



    IF NEW.finalizado = 1 AND OLD.finalizado != 1 THEN



        SET new.dataFinalizacao = DATE_FORMAT(NOW(), '%d/%m/%Y');



        SET NEW.situacao = "Finalizada";



    ELSEIF NEW.finalizado = 0 AND OLD.finalizado != 0 AND NEW.situacao = OLD.situacao THEN



        SET NEW.situacao = "Vigente";



        SET new.dataFinalizacao = null;



	ELSEIF NEW.finalizado = 0 AND OLD.finalizado != 0 THEN



        SET new.dataFinalizacao = null;



    ELSEIF NEW.situacao = "Finalizada" AND OLD.situacao != "Finalizada" THEN



        SET new.dataFinalizacao = DATE_FORMAT(NOW(), '%d/%m/%Y');



        SET NEW.finalizado = 1;



    END IF;



END */;;
